import React from "react";
import NavBar from "../components/NavBar";

const Home = () => {
  return (
    <>
      <NavBar />
      <section className="mx-4">
        <h1 className="text-4xl font-semibold">
          Web Developer
          <br /> & UI Designer
        </h1>
      </section>
    </>
  );
};

export default Home;
